  concept: 2774ceba-927d-5a39-a294-f0db64514ff8
  definition: relación que significa que un elemento o un conjunto de elementos de
    un modelo requiere otros elementos del modelo para su especificación o implementación
  examples: []
  notes:
  - Esto significa que la semántica completa de los elementos dependientes es semántica
    o estructuralmente dependiente de la definición de los elementos del proveedor.
